func checkError(err error) {
	if err != nil {
		fmt.Fprintf(os.Stderr, "Fatal error: %s", err.Error())
		os.Exit(1)
	}
}

func generateKeys() {

	for _, address := range nodes {
		nodePrivateKey := GetPrivateKey()
		publicKeyMap[address] = x509.MarshalPKCS1PublicKey(&nodePrivateKey.PublicKey)
		privateKeyMap[address] = x509.MarshalPKCS1PrivateKey(nodePrivateKey)

		fmt.Println("public key bytes for nodeid = \"", address, "\" : {")
		printBytes(publicKeyMap[address])
		fmt.Print("}")
		fmt.Println("private key bytes for nodeid = \"", address, "\" : {")
		printBytes(privateKeyMap[address])
		fmt.Print("}")
	}
}

func printBytes(b []byte) {
	for _, bb := range b {
		fmt.Print(bb, ",")
	}

}

func GetPublicKeyForNode(address string) *rsa.PublicKey {

	pkbytes := publicKeyMap[address]
	var pk *rsa.PublicKey
	pk, err1 := x509.ParsePKCS1PublicKey(pkbytes)
	checkError(err1)
	return pk
}

func GetPrivateKeyForNode(address string) *rsa.PrivateKey {

	skbytes := privateKeyMap[address]
	var sk *rsa.PrivateKey
	sk, err2 := x509.ParsePKCS1PrivateKey(skbytes)
	checkError(err2)
	return sk
}

func GetPrivateKey() *rsa.PrivateKey {

	privateKey, err := rsa.GenerateKey(rand.Reader, 2048)
	if err != nil {
		fmt.Println(err.Error)
	}
	return privateKey
}

func GetPublicKeyFromPrivateKey(privateKey *rsa.PrivateKey) *rsa.PublicKey {
	return &privateKey.PublicKey
}

func test() {
	reader := rand.Reader
	privateKey := GetPrivateKey()
	publicKey := GetPublicKeyFromPrivateKey(privateKey)

	data := []byte("test")
	hash := sha256.Sum256(data)
	signature, _ := rsa.SignPKCS1v15(reader, privateKey, crypto.SHA256, hash[:]) //node address

	fmt.Println("Generated signature ", signature)
	fmt.Println(rsa.VerifyPKCS1v15(publicKey, crypto.SHA256, hash[:], signature))
}
